double sqrta(double x){
	double result = 1;
	double temp = 0;
	while (result != temp){
		temp = result;
		result = 0.5 * (result + x / result);
	}
	return result;
}

double sine(double x){
	double result = 0;
	double term = x;
	int n = 1;
	while (term > 0.0001 || term < -0.0001){
		result += term;
		term = -term * x * x / ((2 * n) * (2 * n + 1));
		n++;
	}
	return result;
}

double cosine(double x){
	double result = 0;
	double term = 1;
	int n = 1;
	while (term > 0.0001 || term < -0.0001){
		result += term;
		term = -term * x * x / ((2 * n - 1) * (2 * n));
		n++;
	}
	return result;
}

