void draw_line(int x0, int y0,int x1, int y1, short int line_color){
	bool is_steep = (ABS(y1-y0)>ABS(x1-x0));
	
	if(is_steep){
		int temp1 = x0;
		x0 = y0;
		y0 = temp1;
		temp1 = x1;
		x1= y1;
		y1 = temp1;
	}if(x0>x1){
		int temp1 = x0;
		x0 = x1;
		x1= temp1;
		temp1 = y0;
		y0=y1;
		y1 = temp1;
	}
	int deltax = x1-x0;
	int deltay = abs(y1-y0);
	int error = -(deltax/2);
	int y = y0;
	int y_step;
	y_step =(y0<y1)?1:-1;
	
	for(int x = x0; x<=x1 ;x++){
		
		if(is_steep){
			plot_pixel(y,x,line_color);
		}
		else{
			plot_pixel (x,y,line_color);
		}
		error =error+deltay;
		if(error >=0){ 
			y = y+y_step;
			error = error-deltax;
		}
		
	}
}

void audio_playback_mono() {
            audiop->control = 0x8; // clear the output FIFOs
            audiop->control = 0x0; // resume input conversion
            for (int i = 0; i < 36966; i++) {
              // output data if there is space in the output FIFOs
              if ((audiop->wsrc != 0) && (audiop->wslc != 0)) {
                  audiop->ldata = samples[i];
                  audiop->rdata = samples[i];
              }
             }
}	

void wait_for_vsync(){
	volatile int* pixel_ctrl_ptr = (int *)0xff203020;
	int status;
	*pixel_ctrl_ptr = 1;
	status = *(pixel_ctrl_ptr+3);
	while((status&0x01)!=0){
		status = *(pixel_ctrl_ptr + 3);
	}
}